class Solution1(object):
    def validPalindrome(self, s):
        """
        :type s: str
        :rtype: bool
        """
        deleted = False
        stack = [s]
        another_ss = None
        while stack:
            ss = stack.pop()
            if not ss:
                return True
            if ss[0] != ss[-1] and not deleted:
                deleted = True
                stack.append(ss[1:])
                another_ss = ss[:-1]
            elif ss[0] != ss[-1]:
                if another_ss is not None:
                    stack.append(another_ss)
                    another_ss = None
                else:
                    return False
            else:
                stack.append(ss[1:-1])
        return True


class Solution(object):
    def validPalindrome(self, s):
        rs = s[::-1]
        if s == rs:
            return True
        # 回文其实判断的是 s == s[::-1]
        # 那么去掉第i个元素，判断剩下的字符串是否符合回文条件
        for i in range(len(s)):
            if s[i] != rs[i]:
                t1 = s[:i] + s[i+1:]
                # 因为去掉元素有两种可能，一种是去掉前面的，一种是去掉后面的
                t2 = rs[:i] + rs[i+1:]
                return t1 == t1[::-1] or t2 == t2[::-1]


if __name__ == '__main__':
    s = "aguokepatgbnvfqmgmlcupuufxoohdfpgjdmysgvhmvffcnqxjjxqncffvmhvgsymdjgpfdhooxfuupuculmgmqfvnbgtapekouga"
    res = Solution().validPalindrome(s)
    print(res)
    assert res

    s = "abc"
    res = Solution().validPalindrome(s)
    print(res)
    assert not res

    s = "aba"
    res = Solution().validPalindrome(s)
    print(res)
    assert res

    s = "abca"
    res = Solution().validPalindrome(s)
    print(res)
    assert res

    s = ""
    res = Solution().validPalindrome(s)
    print(res)
    assert res
